import React, { useState } from "react";

const Contact = () => {
  const [message, setMessage] = useState(false);

  const handleSubmit = (e) => {
    e.preventDefault();
    setMessage(true);
  };
  return (
    <div id="contact">
      <div className="container"></div>
    </div>
  );
};

export default Contact;
